import React from 'react';
import styled from 'styled-components';

const CardStyle = styled.div`
  h4 {color: red}
`;

const HomeListingCard = () => {

  return (
      <CardStyle>
        <h4>Home Listing Card</h4>
      </CardStyle>
  )
};

export default HomeListingCard;
